                <select className={s.select1} id="">
                    <option value="">a</option>
                    <option value="">a</option>
                    <option value="">a</option>
                </select>
                <div>
                    <label>Sort by:  </label>
                    <select className={s.select1} id="">
                        <option value="">a</option>
                        <option value="">a</option>
                        <option value="">a</option>
                    </select>
                </div>
                <input className={s.sumbit} type="submit" value="Submit"/>
            </form>
        </div>
    );
};

export default FilterForm;
